import React from "react";
import { Add } from './App';
import { Sub } from './App';
import { Mul } from './App';
import { Div } from './App';

function Main() {

    return(

        <ul>
            <li>Sum Is : {Add(10,6)}</li>
            <li>Sub Is : {Sub(10,6)}</li>
            <li>Mul Is : {Mul(10,6)}</li>
            <li>Div Is : {Div(10,6)}</li>
        </ul>
    );
    
}

export default Main;
